        ,\"body\":\"- Added \\\"reload\\\" action for dynamically updating the input\
        \ list without\\r\\n  restarting fzf. See https://github.com/junegunn/fzf/issues/1750\
        \ to learn\\r\\n  more about it.\\r\\n  ```sh\\r\\n  # Using fzf as the selector\
        \ interface for ripgrep\\r\\n  RG_PREFIX=\\\"rg --column --line-number --no-heading\
        \ --color=always --smart-case \\\"\\r\\n  INITIAL_QUERY=\\\"foo\\\"\\r\\n\
        \  FZF_DEFAULT_COMMAND=\\\"$RG_PREFIX '$INITIAL_QUERY'\\\" \\\\\\r\\n    fzf\
        \ --bind \\\"change:reload:$RG_PREFIX {q} || true\\\" \\\\\\r\\n        --ansi\
        \ --phony --query \\\"$INITIAL_QUERY\\\"\\r\\n  ```\\r\\n- `--multi` now takes\
        \ an optional integer argument which indicates the maximum\\r\\n  number of\
        \ items that can be selected\\r\\n  ```sh\\r\\n  seq 100 | fzf --multi 3 --reverse\
        \ --height 50%\\r\\n  ```\\r\\n- If a placeholder expression for `--preview`\
        \ and `execute` action (and the\\r\\n  new `reload` action) contains `f` flag,\
        \ it is replaced to the\\r\\n  path of a temporary file that holds the evaluated\
        \ list. This is useful\\r\\n  when you multi-select a large number of items\
        \ and the length of the\\r\\n  evaluated string may exceed [`ARG_MAX`][argmax].\\\
        r\\n  ```sh\\r\\n  # Press CTRL-A to select 100K items and see the sum of\
        \ all the numbers\\r\\n  seq 100000 | fzf --multi --bind ctrl-a:select-all\
        \ \\\\\\r\\n                   --preview \\\"awk '{sum+=\\\\$1} END {print\
        \ sum}' {+f}\\\"\\r\\n  ```\\r\\n- `deselect-all` no longer deselects unmatched\
        \ items. It is now consistent\\r\\n  with `select-all` and `toggle-all` in\
        \ that it only affects matched items.\\r\\n- Due to the limitation of bash,\
        \ fuzzy completion is enabled by default for\\r\\n  a fixed set of commands.\
        \ A helper function for easily setting up fuzzy\\r\\n  completion for any\
        \ command is now provided.\\r\\n  ```sh\\r\\n  # usage: _fzf_setup_completion\
        \ path|dir COMMANDS...\\r\\n  _fzf_setup_completion path git kubectl\\r\\\
        n  ```\\r\\n- Info line style can be changed by `--info=STYLE`\\r\\n    -\
        \ `--info=default`\\r\\n    - `--info=inline` (same as old `--inline-info`)\\\
        r\\n    - `--info=hidden`\\r\\n- Preview window border can be disabled by\
        \ adding `noborder` to\\r\\n  `--preview-window`.\\r\\n- When you transform\
        \ the input with `--with-nth`, the trailing white spaces\\r\\n  are removed.\\\
        r\\n- `ctrl-\\\\`, `ctrl-]`, `ctrl-^`, and `ctrl-/` can now be used with `--bind`\\\
        r\\n- See https://github.com/junegunn/fzf/milestone/15?closed=1 for more details\\\
        r\\n\\r\\n[argmax]: https://unix.stackexchange.com/questions/120642/what-defines-the-maximum-size-for-a-command-single-argument\"\
