        ,\"body\":\"- Added `--layout` option with a new layout called `reverse-list`.\\\
        r\\n    - `--layout=reverse` is a synonym for `--reverse`\\r\\n    - `--layout=default`\
        \ is a synonym for `--no-reverse`\\r\\n- Preview window will be updated even\
        \ when there is no match for the query\\r\\n  if any of the placeholder expressions\
        \ (e.g. `{q}`, `{+}`) evaluates to\\r\\n  a non-empty string.\\r\\n- More\
        \ keys for binding: `shift-{up,down}`, `alt-{up,down,left,right}`\\r\\n- fzf\
        \ can now start even when `/dev/tty` is not available by making an\\r\\n \
        \ educated guess.\\r\\n- Updated the default command for Windows.\\r\\n- Fixes\
        \ and improvements on bash/zsh completion\\r\\n- install and uninstall scripts\
        \ now supports generating files under\\r\\n  `XDG_CONFIG_HOME` on `--xdg`\
        \ flag.\\r\\n\\r\\nSee https://github.com/junegunn/fzf/milestone/12?closed=1\
        \ for the full list of\\r\\nchanges.\"},{\"url\":\"https://api.github.com/repos/junegunn/fzf-bin/releases/8750108\"\
