        ,\"body\":\"- New `change` event and `top` action for `--bind`\\r\\n    -\
        \ `fzf --bind change:top`\\r\\n        - Move cursor to the top result whenever\
        \ the query string is changed\\r\\n    - `fzf --bind ctrl-u:unix-word-rubout+top`\\\
        r\\n        - `top` combined with `unix-word-rubout`\\r\\n- Fixed inconsistent\
        \ tiebreak scores when `--nth` is used\\r\\n- Proper display of tab characters\
        \ in `--prompt`\\r\\n- Fixed not to `--cycle` on page-up/page-down to prevent\
        \ overshoot\\r\\n- Git revision in `--version` output\\r\\n- Basic support\
        \ for Cygwin environment\\r\\n- Many fixes in Vim plugin on Windows/Cygwin\
        \ (thanks to @janlazo)\\r\\n\"},{\"url\":\"https://api.github.com/repos/junegunn/fzf-bin/releases/6233659\"\
